import './App.css'; // Import CSS file

function Home() {
  return (
    <main>
      <nav>
        <ul>
          <li>Home</li>
          <li>Apps</li>
          <li>Websites</li>
          <li>Photography</li>
        </ul>
      </nav>

    </main>
  );
}

export default Home;
